        "bodyCopy": {
          "en-US": {
            "content": [
              {
                "content": [
                  {
                    "data": {},
                    "marks": [],
                    "nodeType": "text",
                    "value": "New Building Further Bridges Our Doctor-Patient Care"
                  }
                ],
                "data": {},
                "nodeType": "paragraph"
              },
              {
                "content": [
                  {
                    "data": {},
                    "marks": [],
                    "nodeType": "text",
                    "value": "Slated for completion on June 1, the new Medical Office Building will house City of Hope physicians and leadership staff. "
                  }
                ],
                "data": {},
                "nodeType": "paragraph"
              },
              {
                "content": [
                  {
                    "data": {},
                    "marks": [],
                    "nodeType": "text",
                    "value": "It marks a step forward in our plan to expand the main campus in Duarte, California."
                  }
                ],
                "data": {},
                "nodeType": "paragraph"
              },
              {
                "content": [
                  {
                    "data": {},
                    "marks": [],
                    "nodeType": "text",
                    "value": "Eventually featuring a bridge to the Duarte Outpatient Clinic, the building will further connect our doctors to our patients and advance how we deliver innovative and compassionate cancer care in the future."
                  }
                ],
                "data": {},
                "nodeType": "paragraph"
              },
              {
                "content": [
                  {
                    "data": {},
                    "marks": [],
                    "nodeType": "text",
                    "value": "Our campus plan is allowing us to expand hope, with the ultimate goal of treating more patients and saving more lives, says Jeff Walker, M.B.A., chief operating officer."
                  }
                ],
                "data": {},
                "nodeType": "paragraph"
              },
              {
                "content": [
                  {
                    "data": {},
                    "marks": [],
                    "nodeType": "text",
                    "value": "The four-story facility will comprise approximately 160 new offices and 310 workstations, a micro-market food service outlet, and a 200-seat auditorium for meetings and research presentations."
                  }
                ],
                "data": {},
                "nodeType": "paragraph"
              },
              {
                "content": [
                  {
                    "data": {},
                    "marks": [],
                    "nodeType": "text",
                    "value": "The sustainable and modern design aims to streamline campus circulation, emphasizing better vehicle and pedestrian flow and enhancing the patient and visitor experience at City of Hope."
                  }
                ],
                "data": {},
                "nodeType": "paragraph"
              }
            ],
            "data": {},
            "nodeType": "document"
