        "bodyCopy": {
          "en-US": {
            "content": [
              {
                "content": [
                  {
                    "data": {},
                    "marks": [],
                    "nodeType": "text",
                    "value": "City of Hope | Newport Beach opened on Jan. 27, growing our clinical network and bringing\nour life-saving cancer care locally to Orange County for the first time.\n\nWith the opening of our Newport Beach site, we launch a new era of cancer care in Orange County, delivering pioneering research and highly specialized care to our communities. This is what our patients asked us to do, and we are honored to answer the call, said Annette M. Walker, president, City of Hope | Orange County. "
                  }
                ],
                "data": {},
                "nodeType": "paragraph"
              },
              {
                "content": [
                  {
                    "data": {},
                    "marks": [],
                    "nodeType": "text",
                    "value": "Located at 1601 Avocado Ave., the Newport Beach site is spearheaded by Ravi Salgia, M.D., professor and chair, Medical Oncology & Therapeutics Research, and other prominent physicians from the main campus.\n\nThe 12,500-square-foot facility premiers an innovative precision prevention and early detection program that will provide a health blueprint to inform patients and their families of their risk factors and preventive measures based on a genetic risk assessment and breakthrough technologies.\n\nKandace McMenomy commuted to Duarte from Newport Beach regularly during her diagnosis and treatment for stage 2 breast cancer. "
                  }
                ],
                "data": {},
                "nodeType": "paragraph"
              },
              {
                "content": [
                  {
                    "data": {},
                    "marks": [],
                    "nodeType": "text",
                    "value": "I knew I wanted a leader in cancer care, which is why I turned to City of Hope for my treatment. Having these services closer to home will mean so much to all who are impacted by cancer. This is a great thing for our community, McMenomy says. \n\nOrange Countys first hospital dedicated exclusively to treating and curing cancer is planned for City of Hope | Irvine in 2025. The Irvine campus will be on 11 acres at FivePoint Gateway, housing a comprehensive clinical hub for specialized cancer care, phase 1-3 clinical trials, precision medicine, early detection and prevention programs, and more. "
                  }
                ],
                "data": {},
                "nodeType": "paragraph"
              }
            ],
            "data": {},
            "nodeType": "document"
          }
