        "bodyCopy": {
          "en-US": {
            "content": [
              {
                "content": [
                  {
                    "data": {},
                    "marks": [],
                    "nodeType": "text",
                    "value": "In fall 2019, City of Hope will break ground on its new Duarte Outpatient Clinic  a state-of-the-art facility that will greatly expand our ambulatory care services to support our ever-growing patient volumes and new treatments that make it possible for more services in an outpatient setting."
                  }
                ],
                "data": {},
                "nodeType": "paragraph"
              },
              {
                "content": [
                  {
                    "data": {},
                    "marks": [],
                    "nodeType": "text",
                    "value": "Scheduled to open in 2024, the clinic will occupy the previous location of the Needleman, Wing IV, Machris and Modular 170 buildings, all of which will be demolished later this year. At eight stories and over 350,000 square feet, the Duarte Outpatient Clinic will become the largest ambulatory care building on our campus and a beacon of hope."
                  }
                ],
                "data": {},
                "nodeType": "paragraph"
              },
              {
                "content": [
                  {
                    "data": {},
                    "marks": [],
                    "nodeType": "text",
                    "value": "The DOC will allow us to expand and reposition services that need to be close to each other or embedded within a common care center in a multidisciplinary model, says Joel Helmke, senior vice president of Operations."
                  }
                ],
                "data": {},
                "nodeType": "paragraph"
              },
              {
                "content": [
                  {
                    "data": {},
                    "marks": [],
                    "nodeType": "text",
                    "value": "Compared to the existing Geri & Richard Brawerman Ambulatory Care Center, the DOC will be three-and-a-half times larger, providing a significant increase in exam rooms and infusion space, as well as dedicated imaging services, he adds."
                  }
                ],
                "data": {},
                "nodeType": "paragraph"
              },
              {
                "content": [
                  {
                    "data": {},
                    "marks": [],
                    "nodeType": "text",
                    "value": "The clinic will open with two-and-a-half shelled floors  a strategic decision that allows us to open more space in the future.\nThis is a 30-year building, Helmke said. We expect to continue to grow for many, many years."
                  }
                ],
                "data": {},
                "nodeType": "paragraph"
              },
              {
                "content": [
                  {
                    "data": {},
                    "marks": [],
                    "nodeType": "text",
                    "value": "The clinic will house state-of-the-art equipment, specialty clinics, new radiation oncology vaults, defined units to facilitate patient navigation, laboratory services and dedicated clinical trial infusion and monitoring. \nIt will create enclosed walkways and bridges between buildings to provide a more safe and comfortable space for travel, especially for our immuno-compromised patients, and allow our physicians and staff to move more easily throughout the clinical facilities."
                  }
                ],
                "data": {},
                "nodeType": "paragraph"
              },
              {
                "content": [
                  {
                    "data": {},
                    "marks": [],
                    "nodeType": "text",
                    "value": "In addition to the enhanced experience for our patients, the clinic will feature several amenities for staff, including break rooms and conference spaces, a farm-to-table cafe with indoor and outdoor seating, food lockers for online orders, a chefs table and The Pantry, a convenient grab-and-go station. "
                  }
                ],
                "data": {},
                "nodeType": "paragraph"
              },
              {
                "content": [
                  {
                    "data": {},
                    "marks": [],
                    "nodeType": "text",
                    "value": "By transforming this site, City of Hope expands our capacity to deliver care and advance the future of health.\n"
                  }
                ],
                "data": {},
                "nodeType": "paragraph"
              }
            ],
            "data": {},
            "nodeType": "document"
          }
