    {
      "fields": {
        "name": {
          "en-US": "Text Block -Duarte"
        },
        "overlayCopy": {
          "en-US": {
            "content": [
              {
                "content": [
                  {
                    "data": {},
                    "marks": [
                      {
                        "type": "bold"
                      }
                    ],
                    "nodeType": "text",
                    "value": "Duarte and neighboring Irwindale have been home to City of Hope ever since a group of volunteers set up two large tents on a plot of empty desert to treat tuberculosis patients more than 100 years ago. While we have changed quite a bit since 1913, our bond to our home community remains as strong as ever."
                  },
                  {
                    "data": {},
                    "marks": [],
                    "nodeType": "text",
                    "value": "\n \nSupporting our communities is fundamental to City of Hopes mission. Working with a variety of local partners and stakeholders, we provide millions of dollars a year to programs and activities that serve our region. Among our many community-serving initiatives, we work to:\n \n Promote health and wellness\n Address health disparities and access to care\n Advance disease prevention and education\n Celebrate diversity and inclusion\n Educate and train young people to develop a pipeline for tomorrows health-care leaders"
                  }
                ],
                "data": {},
                "nodeType": "paragraph"
              },
              {
                "content": [
                  {
                    "data": {},
                    "marks": [],
                    "nodeType": "text",
                    "value": "Overall, City of Hope participates in more than 200 community outreach events and programs."
                  }
                ],
                "data": {},
                "nodeType": "paragraph"
              }
            ],
            "data": {},
            "nodeType": "document"
